// SPDX-License-Identifier: MIT
pragma solidity > 0.5.0;

contract Marketplace {

    struct Product {
        uint id;
        string name;
        uint price;
        address payable owner;
        bool purchased;
    }

    event productCreated (
        uint id,
        string name, 
        uint price,
        address payable owner,
        bool purchased
    );

    event productPurchased(
        uint id,
        string name,
        address payable owner,
        bool purchased
    );

    function createProduct(string memory name, uint price) public{

        require(bytes(name).length > 0, "Nome inserito non valido");
        require(price > 0, "Prezzo inserito non valido");

        emit productCreated(0, name, price, payable(msg.sender), false);
    }

}
